import React, { useState } from "react";
import GamePreview from "../components/GamePreview";

const Shop = function(){
    const [games, setgames] = useState([
        {id: 1, title: 'TowerDefence', description: 'A little bit about the good'},
        {id: 2, title: 'Infernal Crusade', description: 'A little bit about the good'},
    ])
    return (
        <div>
            {games.map(game => <GamePreview  game = {game} key = {game.id} />)}
        </div>
    );
}

export default Shop;
